(242, 'theme_mods_vic', 'a:19:{i:0;b:0;s:18:\"nav_menu_locations\";a:1:{s:7:\"primary\";i:2;}s:18:\"custom_css_post_id\";i:1940;s:26:\"foliopress_social_profiles\";s:147:\"https://www.facebook.com/vmjaramillo1, https://twitter.com/vmjaramillo1, https://www.linkedin.com/in/vmjaramillo1/, https://github.com/vmjaramillo1\";s:24:\"foliopress_my_info_title\";s:77:\"Hey!, Hola, soy Víctor Jaramillo, geek de corazón y curioso por naturaleza.\";s:29:\"foliopress_footer_info_center\";i:1;s:23:\"foliopress_footer_fluid\";i:1;s:18:\"foliopress_my_desc\";s:256:\"Siempre intentando aprender algo nuevo, soy un ingeniero en sistemas dedicado al desarrollo software. Fanático de la tecnología, fútbol, anime y rompecabezas. Espero algún día usar la tecnología para ayudar a las personas con problemas psicológicos.\";s:20:\"foliopress_my_avatar\";s:99:\"https://vicstack.com//wp-content/uploads/2018/10/14233251_1248124511887549_213689713911371920_n.jpg\";s:11:\"custom_logo\";i:1907;s:24:\"foliopress_footer_social\";i:0;s:22:\"foliopress_post_layout\";s:9:\"grid_view\";s:22:\"foliopress_site_layout\";s:4:\"wide\";s:25:\"foliopress_featured_image\";i:1;s:25:\"foliopress_content_layout\";s:5:\"right\";s:23:\"foliopress_header_fixed\";i:1;s:22:\"foliopress_hide_search\";i:0;s:16:\"header_textcolor\";s:5:\"blank\";s:12:\"header_image\";s:13:\"remove-header\";}', 'yes'),
