(1, 1, '2018-10-07 02:02:37', '2018-10-07 02:02:37', '<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Los decoradores son un patrón de diseño muy importante dentro la programación, estos se fundamentan en un concepto simple pero que en primera instancia puede ser difícil de entender. A continuación, explicaré los puntos principales para entender qué son los decoradores y cómo funcionan, los ejemplos están desarrollados en Python y el código fuente estará subido en un repositorio de GitHub en el siguiente link. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>Concepto </strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Tomando la definición del libro “Python para todos” podemos decir que:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><em><strong>\"Un decorador no es más que una función que recibe una función como parámetro y devuelve otra función como resultado.\"</strong></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O dicho en palabras más sencillas, un decorador no es más que una función que envuelve a otra función para modificar su comportamiento ya sea antes o después, supongamos que tenemos esto:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>@pedir_comida\ndef comer():\n	pass</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Lo primero que tenemos que entender es que el decorador @pedir_comida\nes en realidad una función, y sus operaciones son las que se van a ejecutar\nantes (o después dependiendo del caso) del código de la función comer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Este patrón es muy utilizado, debido a que nos permite encapuzar funcionalidades para poder reutilizar más código y ser menos redundantes. Otro ejemplo un poco más real podría ser, el de un decorador que valide un usuario y contraseña antes de efectuar una actualización en los datos de perfil de una persona, si lo desean pueden encontrar el código del ejemplo <a href=\"https://github.com/victor0402m/decoradores_python\" target=\"_blank\" rel=\"noreferrer noopener\" aria-label=\"aquí (abre en una nueva pestaña)\">aquí</a>. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Implementación</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Ahora que ya entendemos que son los decoradores, vamos a\nintentar profundizar un poco más en el tema escribiendo nuestros propios\ndecoradores, esto tendrán como objetivo simular una función protegida por\ncontraseña y una conversión a mayúsculas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Lo primero que realizamos es crear la estructura y funcionalidad base de nuestro proyecto, la cual consta simplemente una función llamada say_hello que imprime un mensaje de saludo y la función principal para el proyecto. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>#Funcion para saludar, recibiré el nombre de la persona y \n# retorna un saludo \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n#Funcion principal\nif __name__ == \'__main__\':\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Partiendo de aquí, vamos a aplicar nuestro primer decorador, para esto declaramos la función decorator_name y la llamamos tal como se muestra a continuación</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>#Función que implementa la lógica del decorado, cambia a mayúsculas un texto\n#Esta function restive say_hello como parámetro\ndef decorator_name(func): \n	#Se declara wrapper, es aquí donde se modificara de manera indirecta la \n	#funcionalidad de nuestra función say_hello \n	def wrapper(*args, **kargs):\n		#Aqui se puede ejecutar lógica antes de la ejecución de la \n		#función say_hello\n		restult = func(*args, **kargs)\n		return restult.upper()\n	\n	return wrapper\n\n\n#Llamado al decorador\n@decorator_name \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n\nif __name__ == \'__main__\':	\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Este es un ejemplo clásico de un decorador python, la función decorator_name recibe como parámetro la función say_name. Luego dentro del decorator_name se declara la función wrapper, que permitirá modificar o aplicar cualquier lógica que necesitemos ya sea antes o después de la ejecución propia de say_hello. En este caso para no complicar el ejemplo únicamente efectuaremos una conversión a mayúsculas y luego continuamos con la ejecución normal. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Finalmente, ahora incluiremos la protección por clave, para esto implementaremos el siguiente código dentro de nuestro ejemplo:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>PASSWORD = \'12345\' #clave de acceso\n\n#Función que implementa la lógica del decorador para pedir la clave\ndef password_requierd(func):\n	def wrapper():\n		passdord = input(\'Cual es tu clave? \')\n\n		if passdord == PASSWORD:\n			return func()\n		print(\'La clave es incorrecta\')\n\n	return wrapper\n\n#Decorador que llama a la función para validar y pedir la clave\n@password_requierd\ndef needs_password():\n	print(\"Ingreso al sistema exitoso\")\n	return True\n\n\ndef decorator_name(func):\n	def wrapper(*args, **kargs):\n		restult = func(*args, **kargs)\n\n		return restult.upper()\n	return wrapper\n\n\n@decorator_name\ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\nif __name__ == \'__main__\':\n	if needs_password():	#Incluimos una función que indica si la clave es correcta \n		print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Al final podemos ver como mediante los decoradores resulta más sencillo la reutilización de código en nuestro proyectos. Espero que esta explicación les haya servido, y cualquier duda o inquietud estaré feliz de responder en los comentarios. </p>\n<!-- /wp:paragraph -->', 'Decoradores python, qué son y cómo funcionan?', 'En esta entrada se explica el tema referente a los decoradores en python,  abarcando puntualmente su uso y definición.', 'publish', 'open', 'open', '', 'decoradores-python-que-son-y-como-funcionan', '', '', '2019-10-12 09:44:44', '2019-10-12 09:44:44', '', 0, 'http://vicstack.com//?p=1', 0, 'post', '', 1),
(8, 1, '2018-10-17 04:21:03', '2018-10-17 04:21:03', '', '14233251_1248124511887549_213689713911371920_n', '', 'inherit', 'open', 'closed', '', '14233251_1248124511887549_213689713911371920_n', '', '', '2018-10-17 04:21:03', '2018-10-17 04:21:03', '', 0, 'http://vicstack.com//wp-content/uploads/2018/10/14233251_1248124511887549_213689713911371920_n.jpg', 0, 'attachment', 'image/jpeg', 0),
(358, 1, '2010-10-05 00:27:25', '2010-10-05 07:27:25', 'All children, except one, grow up. They soon know that they will grow up, and the way Wendy knew was this. One day when she was two years old she was playing in a garden, and she plucked another flower and ran with it to her mother. I suppose she must have looked rather delightful, for Mrs. Darling put her hand to her heart and cried, \"Oh, why can\'t you remain like this for ever!\" This was all that passed between them on the subject, but henceforth Wendy knew that she must grow up. You always know after you are two. Two is the beginning of the end.\n\n<!--more-->\n\nMrs. Darling first heard of Peter when she was tidying up her children\'s minds. It is the nightly custom of every good mother after her children are asleep to rummage in their minds and put things straight for next morning, repacking into their proper places the many articles that have wandered during the day.\n\nIf you could keep awake (but of course you can\'t) you would see your own mother doing this, and you would find it very interesting to watch her. It is quite like tidying up drawers. You would see her on her knees, I expect, lingering humorously over some of your contents, wondering where on earth you had picked this thing up, making discoveries sweet and not so sweet, pressing this to her cheek as if it were as nice as a kitten, and hurriedly stowing that out of sight. When you wake in the morning, the naughtiness and evil passions with which you went to bed have been folded up small and placed at the bottom of your mind and on the top, beautifully aired, are spread out your prettier thoughts, ready for you to put on.\n\nI don\'t know whether you have ever seen a map of a person\'s mind. Doctors sometimes draw maps of other parts of you, and your own map can become intensely interesting, but catch them trying to draw a map of a child\'s mind, which is not only confused, but keeps going round all the time. There are zigzag lines on it, just like your temperature on a card, and these are probably roads in the island, for the Neverland is always more or less an island, with astonishing splashes of colour here and there, and coral reefs and rakish-looking craft in the offing, and savages and lonely lairs, and gnomes who are mostly tailors, and caves through which a river runs, and princes with six elder brothers, and a hut fast going to decay, and one very small old lady with a hooked nose. It would be an easy map if that were all, but there is also first day at school, religion, fathers, the round pond, needle-work, murders, hangings, verbs that take the dative, chocolate pudding day, getting into braces, say ninety-nine, three-pence for pulling out your tooth yourself, and so on, and either these are part of the island or they are another map showing through, and it is all rather confusing, especially as nothing will stand still.\n\nOf course the Neverlands vary a good deal. John\'s, for instance, had a lagoon with flamingoes flying over it at which John was shooting, while Michael, who was very small, had a flamingo with lagoons flying over it. John lived in a boat turned upside down on the sands, Michael in a wigwam, Wendy in a house of leaves deftly sewn together. John had no friends, Michael had friends at night, Wendy had a pet wolf forsaken by its parents, but on the whole the Neverlands have a family resemblance, and if they stood still in a row you could say of them that they have each other\'s nose, and so forth. On these magic shores children at play are for ever beaching their coracles [simple boat]. We too have been there; we can still hear the sound of the surf, though we shall land no more.\n\nOf all delectable islands the Neverland is the snuggest and most compact, not large and sprawly, you know, with tedious distances between one adventure and another, but nicely crammed. When you play at it by day with the chairs and table-cloth, it is not in the least alarming, but in the two minutes before you go to sleep it becomes very real. That is why there are night-lights.\n\nOccasionally in her travels through her children\'s minds Mrs. Darling found things she could not understand, and of these quite the most perplexing was the word Peter. She knew of no Peter, and yet he was here and there in John and Michael\'s minds, while Wendy\'s began to be scrawled all over with him. The name stood out in bolder letters than any of the other words, and as Mrs. Darling gazed she felt that it had an oddly cocky appearance.', 'Post Format: Standard', '', 'publish', 'closed', 'closed', '', 'post-format-standard', '', '', '2010-10-05 00:27:25', '2010-10-05 07:27:25', '', 0, 'https://wpthemetestdata.wordpress.com/?p=358', 0, 'post', '', 0),
