unction restive say_hello como parámetro\ndef decorator_name(func): \n	#Se declara wrapper, es aquí donde se modificara de manera indirecta la \n	#funcionalidad de nuestra función say_hello \n	def wrapper(*args, **kargs):\n		#Aqui se puede ejecutar lógica antes de la ejecución de la \n		#función say_hello\n		restult = func(*args, **kargs)\n		return restult.upper()\n	\n	return wrapper\n\n\n#Llamado al decorador\n@decorator_name \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n\nif __name__ == \'__main__\':	\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Este es un ejemplo clásico de un decorador, haciendo esto lo\nque conseguimos es que la función decorator_name reciba como parámetro la\nfunción say_name, luego dentro del decorator_name declaramos la función\nwrapper, que nos permitira modificar o aplicar cualquier lógica que necesitemos\nya sea antes o después de la ejecución propia de say_hello. En este caso para\nno complicar el ejemplo únicamente efectuaremos una conversión a mayúsculas y\nluego continuamos con la ejecución normal. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Finalmente, ahora incluiremos la protección por clave, para esto implementaremos el siguiente código dentro de nuestro ejemplo:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>PASSWORD = \'12345\' #clave de acceso\n\n#Función que implementa la lógica del decorador para pedir la clave\ndef password_requierd(func):\n	def wrapper():\n		passdord = input(\'Cual es tu clave? \')\n\n		if passdord == PASSWORD:\n			return func()\n		print(\'La clave es incorrecta\')\n\n	return wrapper\n\n#Decorador que llama a la función para validar y pedir la clave\n@password_requierd\ndef needs_password():\n	print(\"Ingreso al sistema exitoso\")\n	return True\n\n\ndef decorator_name(func):\n	def wrapper(*args, **kargs):\n		restult = func(*args, **kargs)\n\n		return restult.upper()\n	return wrapper\n\n\n@decorator_name\ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\nif __name__ == \'__main__\':\n	if needs_password():	#Incluimos una función que indica si la clave es correcta \n		print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Al final podemos ver como mediante los decoradores resulta más sencillo la reutilización de código, espero que esta explicación les haya servido, y cualquier duda o inquietud estaré feliz de responder en los comentarios. </p>\n<!-- /wp:paragraph -->', 'Decoradores, qué son y cómo funcionan?', 'En esta entrada se explica el tema referente a los decoradores en python,  abarcando puntualmente su uso y definición.', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2019-10-12 09:34:50', '2019-10-12 09:34:50', '', 1, 'https://vicstack.com/1-revision-v1/', 0, 'revision', '', 0),
(2061, 1, '2019-10-12 09:37:16', '2019-10-12 09:37:16', '<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Los decoradores son un patrón de diseño muy importante dentro la programación, estos se fundamentan en un concepto simple pero que en primera instancia puede ser difícil de entender. A continuación, explicaré los puntos principales para entender qué son los decoradores y cómo funcionan, los ejemplos están desarrollados en Python y el código fuente estará subido en un repositorio de GitHub en el siguiente link. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>Concepto </strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Tomando la definición del libro “Python para todos” podemos decir que:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><em><strong>\"Un decorador no es más que una función que recibe una función como parámetro y devuelve otra función como resultado.\"</strong></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O dicho en palabras más sencillas, un decorador no es más que una función que envuelve a otra función para modificar su comportamiento ya sea antes o después, supongamos que tenemos esto:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>@pedir_comida\ndef comer():\n	pass</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Lo primero que tenemos que entender es que el decorador @pedir_comida\nes en realidad una función, y sus operaciones son las que se van a ejecutar\nantes (o después dependiendo del caso) del código de la función comer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Este patrón es muy utilizado, debido a que nos permite encapuzar funcionalidades para poder reutilizar más código y ser menos redundantes. Otro ejemplo un poco más real podría ser, el de un decorador que valide un usuario y contraseña antes de efectuar una actualización en los datos de perfil de una persona, si lo desean pueden encontrar el código del ejemplo <a href=\"https://github.com/victor0402m/decoradores_python\" target=\"_blank\" rel=\"noreferrer noopener\" aria-label=\"aquí (abre en una nueva pestaña)\">aquí</a>. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Implementación</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Ahora que ya entendemos que son los decoradores, vamos a\nintentar profundizar un poco más en el tema escribiendo nuestros propios\ndecoradores, esto tendrán como objetivo simular una función protegida por\ncontraseña y una conversión a mayúsculas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Lo primero que realizamos es crear la estructura y funcionalidad base de nuestro proyecto, la cual consta simplemente una función llamada say_hello que imprime un mensaje de saludo y la función principal para el proyecto. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>#Funcion para saludar, recibiré el nombre de la persona y \n# retorna un saludo \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n#Funcion principal\nif __name__ == \'__main__\':\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Partiendo de aquí, vamos a aplicar nuestro primer decorador, para esto declaramos la función decorator_name y la llamamos tal como se muestra a continuación</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>#Función que implementa la lógica del decorado, cambia a mayúsculas un texto\n#Esta function restive say_hello como parámetro\ndef decorator_name(func): \n	#Se declara wrapper, es aquí donde se modificara de manera indirecta la \n	#funcionalidad de nuestra función say_hello \n	def wrapper(*args, **kargs):\n		#Aqui se puede ejecutar lógica antes de la ejecución de la \n		#función say_hello\n		restult = func(*args, **kargs)\n		return restult.upper()\n	\n	return wrapper\n\n\n#Llamado al decorador\n@decorator_name \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n\nif __name__ == \'__main__\':	\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Este es un ejemplo clásico de un decorador, haciendo esto lo\nque conseguimos es que la función decorator_name reciba como parámetro la\nfunción say_name, luego dentro del decorator_name declaramos la función\nwrapper, que nos permitira modificar o aplicar cualquier lógica que necesitemos\nya sea antes o después de la ejecución propia de say_hello. En este caso para\nno complicar el ejemplo únicamente efectuaremos una conversión a mayúsculas y\nluego continuamos con la ejecución normal. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Finalmente, ahora incluiremos la protección por clave, para esto implementaremos el siguiente código dentro de nuestro ejemplo:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>PASSWORD = \'12345\' #clave de acceso\n\n#Función que implementa la lógica del decorador para pedir la clave\ndef password_requierd(func):\n	def wrapper():\n		passdord = input(\'Cual es tu clave? \')\n\n		if passdord == PASSWORD:\n			return func()\n		print(\'La clave es incorrecta\')\n\n	return wrapper\n\n#Decorador que llama a la función para validar y pedir la clave\n@password_requierd\ndef needs_password():\n	print(\"Ingreso al sistema exitoso\")\n	return True\n\n\ndef decorator_name(func):\n	def wrapper(*args, **kargs):\n		restult = func(*args, **kargs)\n\n		return restult.upper()\n	return wrapper\n\n\n@decorator_name\ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\nif __name__ == \'__main__\':\n	if needs_password():	#Incluimos una función que indica si la clave es correcta \n		print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Al final podemos ver como mediante los decoradores resulta más sencillo la reutilización de código, espero que esta explicación les haya servido, y cualquier duda o inquietud estaré feliz de responder en los comentarios. </p>\n<!-- /wp:paragraph -->', 'Decoradores python, qué son y cómo funcionan?', 'En esta entrada se explica el tema referente a los decoradores en python,  abarcando puntualmente su uso y definición.', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2019-10-12 09:37:16', '2019-10-12 09:37:16', '', 1, 'https://vicstack.com/1-revision-v1/', 0, 'revision', '', 0),
(2063, 1, '2019-10-12 09:42:48', '2019-10-12 09:42:48', '<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Los decoradores son un patrón de diseño muy importante dentro la programación, estos se fundamentan en un concepto simple pero que en primera instancia puede ser difícil de entender. A continuación, explicaré los puntos principales para entender qué son los decoradores y cómo funcionan, los ejemplos están desarrollados en Python y el código fuente estará subido en un repositorio de GitHub en el siguiente link. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>Concepto </strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Tomando la definición del libro “Python para todos” podemos decir que:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p style=\"text-align:center\"><em><strong>\"Un decorador no es más que una función que recibe una función como parámetro y devuelve otra función como resultado.\"</strong></em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O dicho en palabras más sencillas, un decorador no es más que una función que envuelve a otra función para modificar su comportamiento ya sea antes o después, supongamos que tenemos esto:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>@pedir_comida\ndef comer():\n	pass</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Lo primero que tenemos que entender es que el decorador @pedir_comida\nes en realidad una función, y sus operaciones son las que se van a ejecutar\nantes (o después dependiendo del caso) del código de la función comer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Este patrón es muy utilizado, debido a que nos permite encapuzar funcionalidades para poder reutilizar más código y ser menos redundantes. Otro ejemplo un poco más real podría ser, el de un decorador que valide un usuario y contraseña antes de efectuar una actualización en los datos de perfil de una persona, si lo desean pueden encontrar el código del ejemplo <a href=\"https://github.com/victor0402m/decoradores_python\" target=\"_blank\" rel=\"noreferrer noopener\" aria-label=\"aquí (abre en una nueva pestaña)\">aquí</a>. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Implementación</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Ahora que ya entendemos que son los decoradores, vamos a\nintentar profundizar un poco más en el tema escribiendo nuestros propios\ndecoradores, esto tendrán como objetivo simular una función protegida por\ncontraseña y una conversión a mayúsculas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Lo primero que realizamos es crear la estructura y funcionalidad base de nuestro proyecto, la cual consta simplemente una función llamada say_hello que imprime un mensaje de saludo y la función principal para el proyecto. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>#Funcion para saludar, recibiré el nombre de la persona y \n# retorna un saludo \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n#Funcion principal\nif __name__ == \'__main__\':\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Partiendo de aquí, vamos a aplicar nuestro primer decorador, para esto declaramos la función decorator_name y la llamamos tal como se muestra a continuación</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>#Función que implementa la lógica del decorado, cambia a mayúsculas un texto\n#Esta function restive say_hello como parámetro\ndef decorator_name(func): \n	#Se declara wrapper, es aquí donde se modificara de manera indirecta la \n	#funcionalidad de nuestra función say_hello \n	def wrapper(*args, **kargs):\n		#Aqui se puede ejecutar lógica antes de la ejecución de la \n		#función say_hello\n		restult = func(*args, **kargs)\n		return restult.upper()\n	\n	return wrapper\n\n\n#Llamado al decorador\n@decorator_name \ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\n\nif __name__ == \'__main__\':	\n	print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Este es un ejemplo clásico de un decorador, la función decorator_name recibe como parámetro la función say_name. Luego dentro del decorator_name se declara la función wrapper, que permitirá modificar o aplicar cualquier lógica que necesitemos ya sea antes o después de la ejecución propia de say_hello. En este caso para no complicar el ejemplo únicamente efectuaremos una conversión a mayúsculas y luego continuamos con la ejecución normal. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Finalmente, ahora incluiremos la protección por clave, para esto implementaremos el siguiente código dentro de nuestro ejemplo:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>PASSWORD = \'12345\' #clave de acceso\n\n#Función que implementa la lógica del decorador para pedir la clave\ndef password_requierd(func):\n	def wrapper():\n		passdord = input(\'Cual es tu clave? \')\n\n		if passdord == PASSWORD:\n			return func()\n		print(\'La clave es incorrecta\')\n\n	return wrapper\n\n#Decorador que llama a la función para validar y pedir la clave\n@password_requierd\ndef needs_password():\n	print(\"Ingreso al sistema exitoso\")\n	return True\n\n\ndef decorator_name(func):\n	def wrapper(*args, **kargs):\n		restult = func(*args, **kargs)\n\n		return restult.upper()\n	return wrapper\n\n\n@decorator_name\ndef say_hello(name):\n	return \'Hola, {}\'.format(name)\n\nif __name__ == \'__main__\':\n	if needs_password():	#Incluimos una función que indica si la clave es correcta \n		print(say_hello(\'vic\'))</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Al final podemos ver como mediante los decoradores resulta más sencillo la reutilización de código en nuestro proyectos. Espero que esta explicación les haya servido, y cualquier duda o inquietud estaré feliz de responder en los comentarios. </p>\n<!-- /wp:paragraph -->', 'Decoradores python, qué son y cómo funcionan?', 'En esta entrada se explica el tema referente a los decoradores en python,  abarcando puntualmente su uso y definición.', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2019-10-12 09:42:48', '2019-10-12 09:42:48', '', 1, 'https://vicstack.com/1-revision-v1/', 0, 'revision', '', 0),
