(2066, 1, '2019-10-27 18:15:15', '2019-10-27 18:15:15', '<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">En muchos aspectos el arte de la programación puede resultar\ncomplicado de aprender, sobre todo al principio, cuando recién se comienza a\nconocer sobre estructuras de datos, variables, constantes, algoritmos y otros\nconceptos básicos de la codificación.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Sin embargo, conforme el tiempo pasa y uno gana más experiencia, se comienza a notar una evolución en el código que escribimos, pasando por distintas fases donde lo importante ya no solo es que el programa funcione bien, además debe ser mantenible, tener nombres claros de variables, debe estar bien documentado y entre otros aspectos. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Esta evolución, es causada por problemas y dificultades que nosotros mismos nos generamos, ya por nuestra falta de experiencia o conocimiento y que nos vemos obligados a solucionar sobre la marcha, estas lecciones son doloras de aprender, y estoy seguro que a más de uno de nosotros nos hubiera gustado poder evitar todos los líos y problemas que conllevan.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Pues bien, si tu eres nuevo en la programación o si ya tienes\nalgo de experiencia, pero te gustaría ser aún mejor y poder evitarte algunos de\nlos dolores de cabeza que mencionaba antes, hay un libro que me gustaría\nrecomendarte, en mi opinión este es uno de esos libros que si estas en la\nindustria del software debes leer por lo menos una vez.&nbsp; </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"justify\"} -->\n<p style=\"text-align:justify\">Estoy hablando del libro “Código Limpio” escrito por Robert C. Martin, aquí encontrarás lo que yo llamo, las verdaderas perlas de la programación, y si quizá algunos conceptos puede que te resulten familiares, pero la brillantes de este libro, es explicarlos aplicándolos al mundo real, al tiempo que nos ayuda a entender las consecuencias que puede tener cuando no aplicamos lo que nos enseña.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Con esto dicho, te dejo el <a href=\"https://mega.nz/#!2RMxzChR!tgW39oqWLCU-ShlNNjbl6hmiWI3voy9IlqgqUD9TOzw\">link </a>desde el cual puedes descargar una versión del libro, y te animo a que le des una leída, y te aviso, no serás el mismo cuando hayas terminado de leerlo. </p>\n<!-- /wp:paragraph -->', 'El mejor libro de programación que he leído!!', 'Una recomendación, a gusto personal del mejor libro que se pueda leer para ser mejor programador', 'publish', 'open', 'open', '', 'el-mejor-libro-de-programacion', '', '', '2019-10-27 20:03:59', '2019-10-27 20:03:59', '', 0, 'https://vicstack.com/?p=2066', 0, 'post', '', 0),
