(1, 'vicstack.com', '$P$BzxnWd77Y.42XvU61kj5QMqekw2ewJ/', 'vicstack-com', 'vjaramilloespinoza770@gmail.com', '', '2018-10-07 02:02:37', '', 0, 'Vic');
INSERT INTO `wpv0_web_paceportfolio_images` (`id`, `name`, `portfolio_id`, `description`, `image_url`, `sl_url`, `sl_type`, `link_target`, `ordering`, `published`, `published_in_sl_width`, `category`, `web_pace_loadDate`) VALUES
(1, 'Diagramación de procesos', '1', '<p>\r\nUn conjunto eficiente y bien definido de procesos es la columna medular de una gran institución, esta es una de las lecciones que se me ha grabado en la memoria luego mi paso por este proyecto.\r\n</p>\r\n<p>\r\nEn esta ocasión el proyecto participe de una manera un tanto diferente a lo que normalmente suelo realizar, esto debido a que mi rol no tuvo ninguna relación con tareas de desarrollo o temas técnicos, en esta ocasión mi función principal fue la de colaborar como analista y documentador de procesos durante el proyecto de actualización y reingeniería procesos que estaba realizando la Universidad Técnica Particular de Loja. \r\n</p>\r\n<p>\r\nPara mi esta fue una experiencia muy enriquecedora, puesto que al poder experimentar el levantamiento de procesos directo con los funcionales, tuve la oportunidad de aprender que en muchas ocasiones las personas no siempre tienen claro cuales son sus roles y obligaciones, siendo este un gran foco de problemas, pero que una vez solucionado, las cosas suelen encajar por sí mismas.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 3 meses<br>\r\n<strong> Metodología:</strong> UML, BMPN<br>\r\n<strong> Herramientas: </strong> Bizagi, Microsoft Visio, Bonita BPM\r\n</p>\r\n', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/11/documentacion1.png;https://vicstack.com/wp-content/uploads/2019/09/documentacion2.png;https://vicstack.com/wp-content/uploads/2019/09/documentacion3.png;', '', 'image', '', 4, 1, NULL, '', '2018-12-16 22:31:23'),
(2, 'Sistema de gestión de ventas Alemont', '1', '<p>\r\nLas ideas de negocio y la tecnología suelen complementarse bien, en esta ocasión el proyecto que voy a relatar retrata muy bien esta relación.\r\n</p>\r\n<p>\r\nEn un comienzo la tienda de productos digitales “Alemont” realizaba todas sus ventas de manera  física, registrando  todo su inventario y productos en libros de excel, sin embargo el efectuar este proceso no solo era sumamente tedioso, si no que además era muy propenso a errores humanos, quitando mucho tiempo a gerentes y vendedores. En este contexto se dio la oportunidad para mejorar el proceso mediante un sistema de venta que además de automatizar el proceso les permitiera tener mucho más control y tener registros más eficientes.  \r\n</p>\r\n<p>\r\nEl proyecto no fue fácil, muchos cambios en el proceso y constantes alteraciones en el negocio, ocasionaron que el proyecto tuviera una mayor envergadura de lo que originalmente se tenía planeado, sin embargo mediante una buena gestión de cambios y una arquitectura flexible todo pudo ser solventado, cumpliendo con las expectativas previstas, permitiendo no solo que el negocio fuera más óptimo, si no que además permitió que los dueños idearon nuevas formas de hacer crecer su negocio con las recién descubiertas nuevas tecnologías.   \r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 6 meses <br>\r\n<strong> Framework/Tecnología:</strong> Codeigniter, MaterialCSS, SASS<br>\r\n<strong> Lenguaje: </strong> PHP, HTML. JS, CSS\r\n<strong> Persistencia de datos:</strong> MySQL<br>\r\n<strong> Servidor:</strong> Centos 7<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/ale.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-19-57-11.jpg;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-19-57-32.jpg;https://vicstack.com/wp-content/uploads/2019/09/Captura-de-pantalla-de-2019-09-20-19-57-59.png;', '', 'video', '', 2, 1, NULL, '', '2018-12-16 22:31:23'),
(3, 'Gestión de clientes', '1', '<p>\r\nEl aprender y experimentar cosas nuevas es fascinante, pero el recordar y nunca creer que lo sabes todo también lo es, en esta ocasión no voy a hablar de un trabajo para cliente o un algún proyecto, esta vez se trata de algo más personal, pero no por eso menos fascinante.\r\n</p>\r\n<p>\r\nPython es uno de los lenguaje que más me gustan, no solo por su potencia y capacidades, si no también por lo flexible que puede ser, pero con lo frágil que es la mente siempre es posible que algunos conceptos se nos escapen, por eso nunca está de más recordar las bases y nada mejor que un proyecto personal para  hacerlo.\r\n</p>\r\n<p>\r\nEsta es una aplicación de consola desarrollada usando puramente python, su funcionalidad es la de registrar y gestionar un listado clientes de la misma forma que lo realizaria una tienda, para la persistencia de datos decidí usar una opción sencilla pero eficiente, guardando la información en un archivo CSV que se actualiza con cada ejecución. \r\n</p>\r\n<p>\r\nSi bien este no es el proyecto más complicado que he realizado, la verdad fue divertido de construir y recordar los principales conceptos de python implementando el todo poderoso CRUD, para mi hizo que valiera la pena.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 2 semanas<br>\r\n<strong> Lenguaje: </strong> Python\r\n<strong> Persistencia de datos:</strong> Archivo CSV<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/logo-porfolio.png;https://vicstack.com//wp-content/plugins/photo-portfolio-gallery/assets/images/front_images/projects/iphone-3.jpg;https://vicstack.com//wp-content/plugins/photo-portfolio-gallery/assets/images/front_images/projects/iphone-3.1.jpg;https://vicstack.com//wp-content/plugins/photo-portfolio-gallery/assets/images/front_images/projects/3.2.jpg:https://www.youtube.com/watch?v=YMQdfGFK5XQ;', '', 'image', '', 6, 1, NULL, '', '2018-12-16 22:31:23'),
(4, 'App Atenea', '1', '<p>\r\nEducación y la tegnologias, dos palabras que básicamente podrían bien definir la vida de muchas personas y más ahora que nuestro mundo cada dia mas depende más de la maquinaria y de los aparatos tecnológicos a los que estamos tan acostumbrados. Pero estas herramientas no sirven de nada sin el conocimiento adecuado de cómo usarla y es aquí donde entra en juego la educación. \r\n</p>\r\n<p>\r\nEn este proyecto una academia de capacitación multidisciplinaria quería encontrar la forma de poder simplificar las inscripcione de sus estudiantes para los cursos que ofertaba, al mismo tiempo que promociona sus nuevas ofertas académicas y expandir su cuota de mercado, para lograrlo se les ocurrió una muy interesante solución, una aplicación móvil que permitiera realizar la reserva de cupos a sus alumnos y notificará de los nuevos cursos que se ofertan en cada temporada.\r\n</p>\r\n<p>\r\nEl desarrollo de esta aplicación fue muy interesante, sobretodo debido al diseño tan particular de la misma, en este caso ya con la experiencia obtenida de nuestros proyectos anteriores, el desarrollo de la aplicación fue mucho más sencillo, en mi caso como era de esperarse debido a mis rol en otros proyectos, fui el responsable de la parte backend de la aplicación, encargandome desde los temas estructurales más fundamentales como son el diseño de base de datos, análisis de requisitos funcionales y validación estructural de la solución, hasta finalmente terminar desarrollando el conjunto de servicios REST y portal de administración.\r\n</p>\r\n<p>\r\nDesde su lanzamiento la academia ha crecido y actualmente se encuentra en un proceso de expansión para otras provincias, siendo la aplicación uno de los principales diferenciadores frente a sus competidores y se planea que a futuro cuente con muchas más funcionalidades las cuales espero con un poco de suerte poder ayudar a desarrollar.  \r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 2 meses<br>\r\n<strong> Framework/Tecnología:</strong> Django<br>\r\n<strong> Lenguaje: </strong> Python, HTML, CSS, JS\r\n<strong> Persistencia de datos:</strong> PostgreSQL <br>\r\n<strong> Servidor:</strong> Centos 7<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/ccccc.png;https://vicstack.com/wp-content/uploads/2019/09/Caffff.png;https://vicstack.com/wp-content/uploads/2019/09/Capturax8.png;https://vicstack.com/wp-content/uploads/2019/09/Capturax9.png;https://vicstack.com/wp-content/uploads/2019/09/Capturax10.png;', '', 'image', '', 10, 1, NULL, '', '2018-12-16 22:31:23'),
(5, 'Plataforma de gestión de leds', '1', '<p>\r\nDentro de la gestión de cualquier institución, el poder revisar y controlar el avance de los objetivos resulta ser esencial, en esta ocasión  voy a relatar sobre un proyecto muy particular que realice con la Universidad Técnica Particular de Loja, esto debido a que en un comienzo se tenía planeado un alcance mucho menor del que resultó al final, y todo esto debido al muy buen resultado que se obtuvo al final de la primera fase de su implementación. \r\n</p>\r\n<p>\r\nDurante el periodo de matrículas en la universidad uno de los principales indicadores que usan para definir las campañas de marketing y acciones publicitarias en general es saber cuántos estudiantes se están matriculando en cada titulación y cómo está progresando el proceso de matrículas en general, sin embargo aunque suene extraño, obtener esta información no es tan sencillo como se pensaría, esto debido a que existen múltiples fuentes de información y filtros que se deben ejecutar, además la cantidad de información que se debe combinar, comparar y cotejar es sumamente alta, debido a que estamos hablando de una institución que tiene acogida a nivel de todo el país.   \r\n</p>\r\n<p>\r\nEsta información en un comienzo era procesada toda de manera manual y requería de mucho tiempo y personal especializado para poder obtener datos relevantes para la toma de decisiones. Este periodo de tiempo implicaba que en el peor de los casos se perdieran posibles estudiantes que de otra forma quizá si se hubieran registrado en algún curso dentro de la UTPL, de ahí la necesidad de mejorar este proceso y como no podía ser de otra forma es bajo este contexto que empieza mi trabajo. \r\n</p>\r\n<p>\r\nEn este proyecto el cual lo trabaje junto con mi socio, lo desarrollamos completamente desde 0, partimos con un conjuntos de datos y matrices que se utilizaban originalmente, he ideamos una plataforma que abarcara las 4 modalidades de estudios que ofrece la UTPL, (presencial, distancia, formación continua y maestrías) y diseñamos una plataforma que permitiera controlar todo el proceso, al mismo tiempo que ya presentaba los resultados de manera numérica, estadística y gráfica para que así los directivos contarán con mayor informacin para tomar sus diferentes secciones.\r\n</p>\r\n<p>\r\nDurante el diseño de la solución uno de los principales problemas al cual nos enfrentamos fue poder hacer encajar la información, esto debido a que existían muchos datos conflictivos y ademas la informacion tenia mucho ruido e inconsistencias, lo cual dificulta su procesamiento y análisis. En más de una ocasión nos vimos forzados a literalmente botar a la basura nuestras ideas iniciales, pero luego de mucho trabajo al fin se resolvió.\r\n</p>\r\n<p>\r\nEl otro gran desafío de este proyecto fue el rendimiento del sistema, para la mayoría de los casos consumir y procesar información no suele ser una tarea muy complicada, pero cuando lo que se trata de una base de varios miles de estudiantes donde se debe identificar cambios minúsculos en múltiples campos y cruzando diferentes orígenes, la cosa se pone más interesante, finalmente luego de usar todos los trucos que conocidos para el procesamiento de datos, además de combinar un buen diseño de base de datos y un eficiente algoritmo de procesamiento logramos obtener resultados satisfactorios. \r\n</p>\r\n<p>\r\nReduciendo el procesamiento que en comienzo las personas encargadas demoran una mañana cada dia para procesar los datos y lo convertimos a una tarea de no más de 5 minutos en donde ya se incluida una tabulación de los resultados y la posibilidad de aplicar diferentes filtros a los datos, una verdadera ventaja en un mundo donde cada segundo que no posees la información puede ser la diferencia entre el éxito o el fracaso para una institución.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 6 meses<br>\r\n<strong> Framework/Tecnología:</strong> Codeigniter, MaterialCSS, SASS<br>\r\n<strong> Lenguaje: </strong> PHP, HTML. JS, CSS\r\n<strong> Persistencia de datos:</strong> MySQL<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/09/modulos.png;https://vicstack.com/wp-content/uploads/2019/09/configuracionlead.png;https://vicstack.com/wp-content/uploads/2019/09/configuracinled2.png;', '', 'image', '', 7, 1, NULL, '', '2018-12-16 22:31:23'),
(6, 'Plataforma de gestión de presupuestos', '1', '<p>\r\nEl presupuesto es una pieza clave de cualquier organización, pero también puede ser un arma de doble filo, si lo  usas bien te impulsará a horizontes nunca pensados, pero si lo usas mal esto te puede significar la ruina. \r\n</p>\r\n<p>\r\nEsta es una realidad que la UTPL tiene siempre muy presente, por eso la importancia de poder mantener un control sobre el presupuestos de sus diferentes  áreas, y una de las más complicadas de controlar es Dirección y comunicación (DIRCOM) donde se gestiona todas las actividades referentes marketing, eventos y comunicación institucional de  la universidad. La dificultad se encuentra en la gran tidad de cuentas que deben ser controladas, pues debido a las múltiples actividades que dirige esta área se han dividido los gastos en diferentes rubros, los cuales se subdividen a su vez en cuentas y es en estas donde se debe controlar el gasto, y aunque existen límites de gasto y reglas para controlar la inversión también existen múltiples reglas especiales que permiten saltar los  límites o pedir extensión sobre los diferentes presupuesto, en resumen controlar los gastos de esta área es como mínimo desafiante y más cuando la única herramienta con la que cuentas son múltiples libros de  excel.\r\n</p>\r\n<p>\r\nEs por estos motivos que con la finalidad de poder aliviar la carga laboral sobre el personal y al mismo tiempo mejorar la eficiencia reduciendo errores se tomó la decisión de desarrollar un sistema que permitiera controlar los gastos y mostrar de manera precisa el presupuesto disponible en cada cuenta para así poder tomar decisiones más rápidas e invertir mejor lo mejor posible los recursos disponibles. \r\n</p>\r\n<p>\r\nEste proyecto como muchos otros lo trabajamos en conjunto mi socio y yo, luego de las reuniones iniciales para poder analizar y definir el proceso nos dimos cuenta que este no iba a ser un simple trabajo de automatización. Los diferentes procesos, rechazo al cambio, información opaca y cambios inesperados fueron solo algunos de los inconvenientes contra los que nos enfrentamos y que nos mostraron que este proyecto no sería nada sencillo de realizar. La fase de análisis fue más difícil, esto debido a que en el área no tenían muy claro cómo debía comportarse el nuevo sistema, y si bien fueron necesarias muchas más reuniones de las que nos hubiera gustado finalmente se logró llegar a un consenso que nos permitió continuar con el diseño y posterior codificación del sistema.\r\n</p>\r\n<p>\r\nNuevamente nosotros nos encargamos de todas las fases del asumiendo múltiples roles según las tareas que efectuamos, entre los roles que ocupe durante la ejecución de este proyecto encontramos: analista, diseñador de base de datos y desarrollador. \r\n</p>\r\n<p>\r\nEl resultado fue un sistema de control de presupuesto según sus especificacion y que aún hoy en día se encuentra en siendo utilizado, cabe destacar que este sistema sufrió una actualización en el año 2019 con la finalidad de poder reflejar la nueva estructructura organización de de DIRCOM, trabajo que como es natural también nos fue encargado y lo realizamos sin mayores inconvenientes.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 5 meses<br>\r\n<strong> Framework/Tecnología:</strong> Codeigniter, MaterialCSS, SASS<br>\r\n<strong> Lenguaje: </strong> PHP, HTML. JS, CSS\r\n<strong> Persistencia de datos:</strong> MySQL<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-20-07-01.jpg;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-20-11-07.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-20-07-53.jpg;', '', 'image', '', 9, 1, NULL, '', '2018-12-16 22:31:23'),
(7, 'App para encuestas', '1', '<br>\r\n<p class=\'portfolio-idea-center\'>\r\n<strong>La información es la clave de la planificación y toma de decisiones.</strong>\r\n</p>\r\n<p>\r\nEsta fue una de las frases que más recuerdo cuando pienso en este proyecto, debido ha que básicamente esto resume la razón por la cual se inició con su desarrollo.  \r\n</p>\r\n<p>\r\nSolicitado por el equipo de márquetin de un candidato para las elecciones provinciales del año 2019 en la ciudad de Loja, se requería una aplicación móvil que colaboraba en la recopilación de información por parte de los votantes, para saber cuáles candidatos eran los preferidos por el electorado y también cuáles eran las principales necesidades que los votantes querían que se resolvieran. \r\n</p>\r\n<p>\r\nFinalmente, luego de un análisis de cómo maquetar y desarrollar la solución, optamos por desarrollar una aplicación híbrida para dispositivos móviles (Android, IOS) que permitiera gestionar las preguntas deseadas mediante una página web. Estás posteriormente serían descargadas y mostradas en los dispositivos móviles para efectuar las encuestas sin la necesidad de internet y una vez terminada la recolección de información, los resultados se sincronizaban en la nube, mostrándose ya tabulados en la página web y listos para analizar.  \r\n</p>\r\n<p>\r\nDurante este proyecto se dividió el trabajo en dos partes, por un lado, se desarrolló la aplicación móvil que realizaría las encuentras y por el otro se encontraba el API REST, desarrollado usando Django y que contendría toda la lógica de la gestión de preguntas y sincronización de la información. \r\n</p>\r\n<p>\r\nMi rol durante este proyecto además de colaborar con el análisis y maquetación de la solución fue encargarme del desarrollo del API REST y dar soporte en la resolución de algunos problemas que surgieron durante todo el ciclo de vida del proyecto.  \r\n</p>\r\n<br>\r\n<strong> Duración:</strong> 2 semanas<br>\r\n<strong> Framework/Tecnología:</strong> 2 semanas<br>\r\n<strong> Lenguaje: </strong> Python, HTML, CSS, JS\r\n<strong> Persistencia de datos: </strong> PostgreSQL\r\n</p>\r\n', 'https://vicstack.com/wp-content/uploads/2019/09/less.png;https://vicstack.com/wp-content/uploads/2019/09/encuentas.png;https://vicstack.com/wp-content/uploads/2019/09/votacion1.png;https://vicstack.com/wp-content/uploads/2019/09/votacion2.png;', '', 'image', '', 8, 1, NULL, '', '2018-12-16 22:31:23'),
(8, 'Bot para matriculas', '1', '<br>\r\n<p>Este fue uno de los proyectos más interesantes en los que he podido trabajar debido a que era algo que no había realizado con anterioridad, fue solicitado por la \"Universidad Técnica Particular de Loja\" y consistía en desarrollar un Bot que permitiera efectuar de manera automática la creación de la solicitud de matrícula en su herramienta de CRM (que en ese tiempo era Microsoft Dynamics 365) para los Lead que tenían identificados. </p> \r\n<p> Lograr efectuar este proyecto, presento más retos de los que se podían esperar en un comienzo, sin embargo, lo primero fue decidir con que tecnología debíamos trabajar, luego de una fase de búsqueda y análisis decidido optar por usar Selenium, que es un entorno de pruebas de software para aplicaciones basadas en la web y que nos permite efectuar la automatización de actividades, simulando la interacción que normalmente seria ejecutada por una persona.</p> \r\n<p>Esto permitió modelar la lógica necesaria para la creación de solicitudes de matrículas que, combinado con la lectura de un archivo de Excel para poder obtener la información de los estudiantes, permitió modelar una solución acorde a las necesidades del cliente. </p>\r\n<p> \r\n<br>\r\n<strong> Duración:</strong> 2 semanas<br>\r\n<strong> Framework/Tecnología:</strong> 2 semanas<br>\r\n<strong> Lenguaje: </strong> Python\r\n<strong> Persistencia de datos:</strong> 2 semanas<br>\r\n<strong> Servidor:</strong> Centos 7<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/04/Captura-de-pantalla-2019-04-03-22.05.57.png;https://vicstack.com/wp-content/uploads/2019/04/Captura-de-pantalla-2019-04-03-22.04.39.png;', '', 'image', '', 11, 1, NULL, '', '2018-12-16 22:31:23'),
(11, 'Gestah (Sistema de Gestión de Talento Humano)', '1', '<p>\r\nEste proyecto es uno de los más grandes y ambiciosos en los que he podido trabajar, en un comienzo era una simple versión mejorada de un antiguo sistema de macros, sin embargo con el pasar del tiempo fue creciendo tanto en complejidad como en ambición.\r\n</p>\r\n<p>\r\nConvirtiéndose en un perfecto ejemplo escalabilidad este sistema tiene como objetivo ofrecer a los Gobiernos Autónomos Descentralizados (GAD) una herramienta de gestión que les facilite efectuar todas las tareas relacionadas al control y manejo de talento humano, esto debido a que en muchos caso las GAD no poseen medios de automatización apropiados para controlar su listado de personal o peor aún, todas sus tareas la realizan de manera manual, basándose netamente en el conocimiento y experiencia de sus empleados, siguiendo muy escasos estándares y no llevando los correctos registros para efectuar seguimientos o faciliten el cambio de personal.\r\n</p>\r\n<p>\r\nEl sistema se encuentra compuesto por 6 grandes módulos que se relacionan y comparten información entre ellos, contemplando áreas tan diversas como la selección, clasificación evaluación y administración del personal, entre otras áreas relacionadas.\r\n</p>\r\n<p>\r\nAl final del día este uno de los proyectos en los proyectos de los que más he aprendido, gracias a que pude aplicar todos mis conocimiento y al mismo tiempo me presento más desafíos de los que jamás pude haber imaginado.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 1.6 años <br>\r\n<strong> Framework/Tecnología:</strong>Codeigniter, MaterialCSS, SASS<br>\r\n<strong> Lenguaje: </strong> PHP, HTML. JS, CSS\r\n<strong> Persistencia de datos:</strong> MySQL<br>\r\n<strong> Servidor:</strong> Centos 7<br>\r\n</p>\r\n', 'https://vicstack.com/wp-content/uploads/2019/09/GESTA.png;https://vicstack.com/wp-content/uploads/2019/09/Captura.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-2019-11-02-k11.jpg;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-2019-11-02-11.jpg;', 'https://gestah.com/', '', 'on', 0, 2, 1, '', '2019-09-14 21:02:31'),
(12, 'Herramienta de gestión y filtrado de estudiantes', '1', '<p>\r\nEl paradigma de la información, es realmente único en el entorno empresarial, poca información y no podrás tomar decisiones acertadas, demasiada información y será tan demorado procesarla que para cuando se termine el análisis habrá pasado demasiado tiempo como para que sea realmente de utilidad.\r\n</p>\r\n<p>\r\nEste paradigma supone un muy delicado equilibrio en donde solo el porcentaje justo de información es realmente de valor, pero qué sucede cuando las reglas de negocio te obligan a sobrepasar los límites manejables de datos? Bueno es ahí cuando interviene la ingeniería, más puntualmente en este caso la ingeniería de software orientada a datos.\r\n</p>\r\n<p>\r\nEn esta ocasión relatare mi experiencia vivida durante el desarrollo de un sistema de  soporte para la Universidad Técnica Particular de Loja durante uno de sus períodos de transición, en este caso el área de Dirección y Comunicación (DIRCOM) se encontraba en el proceso de migración sus plataformas de Gestión de las relaciones con clientes (también llamada CRM por sus siglas en inglés) sin embargo como el trabajo no podía ser detenido los datos generados en la plataforma antigua debían ser automáticamente traspasados a la nueva, hasta ahí no existia ningun problema, salvo por el inconveniente que nadie previó que las dos plataformas no tenía ningún mecanismo de comunicación entre ellas y la única forma de carga masiva de información era mediante la generación y lectura de excel, los cuales a parte de tener datos repetidos se encontraban en formatos distintos.\r\n</p>\r\n<p>\r\nDebido a eso cada dia el encargado de la migración demoraba cerca de 3 horas de la mañana solo en unificar los datos y cargar la información del día anterior, un auténtico dolor de cabeza para cualquier funcional, debido a eso y conociendo acerca de nuestras experiencias anterior en trabajos anteriores con la gestión de información nos pidieron ayuda para poder simplificar ese proceso.  Es así como mi socio y yo nos pusimos manos a la obra en ese encargo, que como era de esperarse debía salir en tiempo record, puesto que no tendria sentido se demoramos más tiempo de lo que demoraría la migración, que estaba proyectada a tener un tiempo de ejecución de aproximadamente un mes y medio. \r\n</p>\r\n<p>\r\nLuego de la fase de analisi correspondiente y considerando las circunstancias en la cuales debemos desarrollar la solución, optamos por efectuar el desarrollo de una aplicacin que efectuando una serie de algoritmos fuera capaz de a partir una serie de excels generados por las herramientas de CRM realizará los respectivos cruces de la información al mismo tiempo que limpiaba los datos, y eliminar la redundancia innecesaria. \r\n</p>\r\n<p>\r\nLa solución como idea no fue complicada, su desarrollo por otra parte es una historia diferente, con el tiempo en contra y los clientes presionado por una solución, nos vimos en la necesidad de trabajar en horario fuera de oficina por así decir, si bien nos vimos forzados a sacrificar alguna noches en vela (más de las que nos hubiera gustado si soy sincero), la solución estuvo lista en solo 5 dias, aunq claro 2 de esos fueron de fin de semana así que técnicamente fueron solo 3 días laborables a los ojos del cliente, quienes debo recalcar estuvieron más que agradecidos y satisfechos con el resultado final.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 5 dias<br>\r\n<strong> Framework/Tecnología:</strong> Codeigniter, MaterialCSS, SASS<br>\r\n<strong> Lenguaje: </strong> PHP, HTML. JS, CSS\r\n<strong> Persistencia de datos:</strong> MySQL<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-20-16-55.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-20-16-35.jpg;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-20-15-23.png;', '', '', '', 3, 2, 1, '', '2019-09-14 22:01:40'),
(13, 'Proyecto de minera y unificación de base de datos', '1', '<p>\r\nPregunta rápida, qué sucede cuando tienes más de 116 diferentes bases de datos en formato excel que deben ser cruzarlas en un formato único, eliminando duplicados, corrigiendo datos mal ingresados y básicamente efectuando minería de datos sobre toda la información, para que mediante su análisis se puedan tomar decisiones cruciales acerca de una muy compleja y costosa campaña de marketing que se realizará dentro de solo 5 dias, como lo solucionarias? \r\n</p>\r\n<p>\r\nBueno basicamente esa es una descripción muy simplificada del escenario que nos planteó la UTPL para este proyecto, ellos debían tomar decisiones cruciales para su campaña de marketing que estaba próxima a realizarse y querían incluir toda la información obtenida de los diferentes colegios y centros universitarios para poder segmentar correctamente el mensaje según los diferentes intereses de cada grupo de posibles estudiantes, el único problema es que no tenían una base unificada con la informacion, asi que nos pidieron ayuda para poder resolver ese inconveniente. \r\nCon el tiempo una vez más en contra nuestra y con la presión de obtener información que fuera de valor para el cliente, no podíamos darnos el lujo de construir una solución desde 0, asi que optamos por usar Open Refine para cumplir con lo solicitado, esta es una herramienta un poco complicada de manejar si no se tiene cuidado, pero que tal como pensamos resultó ser perfecta para el trabajo. \r\n</p>\r\n<p>\r\nOpen Refine si no estás relacionado con la minería de datos puede que no te resulte muy familiar, pero básicamente y sin entrar mucho en detalle, es una herramienta de escritorio de código abierto independiente para la limpieza y transformación de datos a otros formatos, una característica a destacar es que permite la implementación de algoritmos para efectuar operaciones de transformación de los datos, permitiendo reusar consultas con grupos puntuales de datos según se crea necesario.\r\n</p>\r\n<p>\r\nLa potencia de Open Refine, combinada con nuestra experiencia previa en la gestion de informacion resultaron ser una combinación ganadora, y si bien enfrentamos problemas con los límites de procesamiento de nuestros equipos (la cantidad de datos era tan grande, que las computadoras no lo soportaban) con ingenio y creatividad logramos superarlos, terminando justo a tiempo según los plazos acordados. Convirtiéndose así, no solo en uno de nuestros proyecto más demandantes sino también en uno de los más satisfactorios de terminar. \r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 5 dias<br>\r\n<strong> Framework/Tecnología:</strong> Open Refine<br>\r\n<strong> Lenguaje: </strong> Python, GREL\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/11/Captura8.png;https://vicstack.com/wp-content/uploads/2019/09/Captura5.png;', '', '', '', 5, 2, 1, '', '2019-09-14 22:03:28'),
(14, 'Landing page de recolección de datos', '1', '<p>\r\nRecolectar datos en plena era de la información suena como una tarea sencilla, y en realidad si lo es, sin embargo esta información es de poco valor si no te permite tomar decisiones y le agrega valor a la empresa o el proceso.\r\n</p>\r\n<p>\r\nEn este caso voy relatar un proyecto sumamente sencillo tanto de desarrollar como de maquetar, durante una de las campañas de captación de estudiantes mi socio y yo  fuimos los encargados de desarrollar un portal web que permitirá registrar los datos de los posibles estudiantes interesados en matricularse dentro de alguna de las titulaciones ofertadas.\r\n</p>\r\n<p>\r\nEste portal estuvo disponible en los 94 distintos centros universitarios de la UTPL, incluidos los de de madrid y nueva york, al final de la campaña la información fue invaluable, permitiendo la elaboración de múltiples reportes y facilitando la orientación de las acciones posteriores de reclutamiento\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 2 semanas<br>\r\n<strong> Framework/Tecnología:</strong> Codeigniter, MaterialCSS, SASS<br>\r\n<strong> Lenguaje: </strong> PHP, HTML. JS, CSS\r\n<strong> Persistencia de datos:</strong> MySQL<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/11/Captura-de-pantalla-de-2019-09-20-19-59-43.jpg;https://vicstack.com/wp-content/uploads/2019/09/Captura-de-pantalla-de-2019-09-20-19-59-04.png;', '', '', '', 1, 2, 1, '', '2019-09-14 22:04:05'),
(15, 'Frontal de carga de adjuntos UTPL', '1', '<p>\r\nEn un proyecto siempre se intenta planificar lo más posible, procurando anticipar cualquier  eventualidad o problema que se pudiera presentar, pero sin importar la experiencia o cuán preparado se pueda estar, nunca se llega intuit todo.\r\n</p>\r\n<p>\r\nEn este caso durante mi participación en el proyecto de migración del sistema académico realizado en la UTPL, nuestro trabajo consistía  en colaborar en la implementación Banner 9, una herramienta de gestión académica, efectuamos desarrollos de funcionalidades complementarias y adaptamos algunas características generales a los casos específicos que se presentan en nuestro medio.\r\n</p>\r\n<p>\r\nTodo marchaba sin problema, avanzamos bien y lentamente nos acercabamos a la fecha en la cual se probaría el sistema piloto con un grupo de titulaciones, sin embargo cuando llegamos a una funcionalidad en la cual se requiere adjuntar documentos a un grupo de servicios académicos  que se habían automatizado nunca pudimos imaginar el gran problema que esa pequeña funcionalidad podría suponer.\r\n</p>\r\n<p>\r\nPues resulta que el sistema con su gran complejidad y múltiples funcionalidades no considero necesario dejar abierta la posibilidad de adjuntar algún documento, y cuando nos topamos con ese problema como era de esperar lo primero que hicimos fue pedir asesoría de los expertos, es decir consultamos con la compañía desarrolladora y nos dieron una solución, ellos podían implementar esta funcionalidad pero había un pequeño inconveniente, demoraría 4 meses en hacerlo y el piloto debía estar listo en la mitad de tiempo. \r\n</p>\r\n<p>\r\nAnte tal problema el equipo encargado de los servicios básicamente entró en estado de emergencia, una demora de casi 2 meses era impensable, así que ante tales circunstancias  nos pidieron ayuda al equipo técnico preguntando si podíamos hacer el trabajo en ese tiempo. Luego del shock inicial que todos tuvimos al ver a lo que nos enfrentamos nos pusimos manos a la obra, ideamos una solución con la que logramos implementar la funcionalidad de adjuntos y al mismo tiempo cumplir con los plazos. Debido a que era preferíamos evitar en medida de lo posible modificar el código del sistema académico por motivo de garantía y demás, decidimos desarrollar una aplicación satélite que mediante el uso de un servicio REST API se encargará de guardar los adjuntos a las solicitudes de servicios académicos, todo esto envuelto en una capa de seguridad, autenticación federada y envío de información encriptada para mantener al mínimo los problemas de seguridad. \r\n</p>\r\n<p>\r\nPara nuestra suerte uno de mis compañeros del equipo había desarrollado semana antes un API muy sencillo para enviar documentos, este fue el sistema base que ocupamos para la solución, mientras mi colega se encargaba del servicio yo me ocuparía de la aplicacin satélite. También nos vimos en la necesidad de ocuparnos de una modificación en la base de datos para guardar la información pero cuando finalmente logramos concluir los desarrollos y pasar por la muy tediosa tarea de pedir acceso a los servidores y permisos de implementación todo fluyo como el agua.  \r\n</p>\r\n<p>\r\nDemostrando así que sin importar el problema o lo imposible que parezca solucionar algo en un comienzo, con trabajo y dedicacion siempre es posible salir adelante y complir con los objetivos quq se quiere alcanzar.\r\n</p>\r\n<p>\r\n<br>\r\n<strong> Duración:</strong> 1.5 meses<br>\r\n<strong> Framework/Tecnología:</strong> ASP NET MVC, .Net Framework 4.0, Bootstrap<br>\r\n<strong> Lenguaje: </strong> C#, HTML, CSS, JS\r\n<strong> Persistencia de datos:</strong> Oracle<br>\r\n<strong> Servidor:</strong> Windows Server 12<br>\r\n</p>', 'https://vicstack.com/wp-content/uploads/2019/09/1200x630wa.png;https://vicstack.com/wp-content/uploads/2019/09/log-utpl.png;https://vicstack.com/wp-content/uploads/2019/09/Captura9.png;', '', '', '', 12, 2, 1, '', '2019-09-14 22:04:55');
